class Solution(object):
    def findHighAccessEmployees(self, access_times):
        from collections import defaultdict

        def time_diff(t1, t2):
            return abs((int(t1[:2]) * 60 + int(t1[2:])) - (int(t2[:2]) * 60 + int(t2[2:])))

        employees = defaultdict(list)
        for name, time in access_times:
            employees[name].append(time)

        result = set()
        for name, times in employees.items():
            times.sort()
            for i in range(len(times)):
                count = 1
                for j in range(i + 1, len(times)):
                    if time_diff(times[i], times[j]) < 60:
                        count += 1
                    else:
                        break
                if count >= 3:
                    result.add(name)
                    break
        return list(result)
